Godot er en spillprogrammið sem er basarður í javascript. Kaldi til helgistu sem er tónlistur er hjálpfuldur til að munnu á þeim. Fyrir að búa til leiki í Godot, þarf að kalla einnig til helgistu á sínum.

Sýnir þetta sem sæm:

```javascript
# Fjárhaldar vöxtu
import * as GDScript from 'godot'

func _ready():
    # Set up the game
    var scene = GDScript.SceneTree.get_root()
    var main_scene = GDScript.NodePath.new("res://addons/examples/main.tscn")
    scene.add_child(main_scene)
    var player = GDScript.NodePath.new("res://addons/examples/player.tscn")
    scene.add_child(player)
```
